import react, { useState } from "react";

const App = ({ initialCount }) => {
  const [state, setState] = useState({
    count: initialCount,
    name: "Ronny",
  });

  return (
    <>
      <h1>Name: {state.name}</h1>
      <h1>Count: {state.count}</h1>
      <button
        onClick={() =>
          setState({
            ...state,
            count: state.count + 1,
          })
        }
      >
        Increment
      </button>
      <button
        onClick={() =>
          setState({
            ...state,
            count: initialCount,
          })
        }
      >
        Reset Me
      </button>
    </>
  );
};

export default App;
